  constructor(props) {
    super(props);
    this.state = {
      inventory: [],
    };
  }

  componentDidMount(props) {
    const inventory = props.getLoggingList;
    this.setState({ inventory });
  }

  render() {
    return <div></div>;
  }
}

export default connect(mapStateToProps, null)(File1);
